import React from 'react';
import './hello.css';

const curhrs = new Date();
curhrs=  curhrs.getHours();
const Hello = () => {

  return (
    <>
      <div className="container">
        <div className="child">
          <h1>Hello sir,{curhrs} </h1>
        </div>
      </div>
    </>
  )
}

export default Hello;
